import React, { Component } from 'react'
import Head from './Head'

class SortBar extends Component {
  render () {
    return ( 
      <div className="sortbar">
        <div className="sortbar__title">Sort by:</div>
        <div className="sortbar__buttons">
          <div className="sortbar__buttons__recent">Most recent</div>
          <div className="sortbar__buttons__lowest">Lowest price</div>
          <div className="sortbar__buttons__hightest">Highest price</div>
        </div>
      </div>
    )
  }
}

export default SortBar
